{"payload":{"allShortcutsEnabled":true,"fileTree":{"":{"items":[{"name":"APSS.R","path":"APSS.R","contentType":"file"},{"name":"CITATION.cff","path":"CITATION.cff","contentType":"file"},{"name":"DetectAndSolve_debugged.cpp","path":"DetectAndSolve_debugged.cpp","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"illustration.bmp","path":"illustration.bmp","contentType":"file"},{"name":"mainbody_cpp_pos_precise.R","path":"mainbody_cpp_pos_precise.R","contentType":"file"},{"name":"mainbody_cpp_rsid_precise.R","path":"mainbody_cpp_rsid_precise.R","contentType":"file"},{"name":"step2_pos.R","path":"step2_pos.R","contentType":"file"},{"name":"step2_rsid.R","path":"step2_rsid.R","contentType":"file"}],"totalCount":9}},"fileTreeProcessingTime":3.734375,"foldersToFetch":[],"reducedMotionEnabled":"system","repo":{"id":418313812,"defaultBranch":"main","name":"SUMMIT","ownerLogin":"ChongWuLab","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2021-10-17T22:17:57.000-04:00","ownerAvatar":"https://avatars.githubusercontent.com/u/59589025?v=4","public":true,"private":false,"isOrgOwned":true},"refInfo":{"name":"main","listCacheKey":"v0:1661853918.322112","canEdit":true,"refType":"branch","currentOid":"9b11e3d1f4ca00f0dd35a1f777720a616f365528"},"path":"APSS.R","currentUser":{"id":54146498,"login":"hjm2217","userEmail":"hjm19d@fsu.edu"},"blob":{"rawLines":["APSS <- function(directory.working, filename, auto = FALSE, do.return = FALSE, BIG = 2) {\r","    # Packages\r","    suppressMessages(library(data.table))\r","    suppressMessages(library(magrittr))\r","    suppressMessages(library(R.utils))\r","    suppressMessages(library(stringr))\r","\r","    # Length of separator\r","    length.separator <- 120\r","    separator <- rep(\"=\", length.separator) %>% paste0(., collapse = \"\")\r","\r","    # Set working directory\r","    setwd(directory.working)\r","\r","    # Read the input file\r","    check.BIG <- FALSE\r","    if (file.size(filename) >= BIG * 1024 * 1024 * 1024) {\r","        check.BIG <- TRUE\r","        cat(paste0(\"Input dataset is VERY VERY VERY BIG. We have to be selective :-<<<\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        raw.try <- fread(filename, showProgress = FALSE, nrows = 100) %>% as.data.frame()\r","\r","        # Print the head of the input dataset\r","        cat(\"Following are the first few lines of the dataset:\", sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        print(head(raw.try))\r","        cat(separator, sep = \"\\n\")\r","\r","        # Ask user to pick some columns \r","        cat(\"Press ENTER to skip a column! Write something if you want to keep a column. \", sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        keep <- character(ncol(raw.try))\r","        for (index in 1:ncol(raw.try)) {\r","            keep[index] <- readline(prompt = paste0(\"Keep \", colnames(raw.try)[index], \"? \"))\r","        }\r","        cat(separator, sep = \"\\n\")\r","        keep <- which(keep != \"\")\r","\r","        rm(raw.try)\r","\r","        raw <- fread(filename, showProgress = FALSE, select = keep, fill = TRUE) %>% as.data.frame()\r","    } else {\r","        raw <- fread(filename, showProgress = FALSE, fill = TRUE) %>% as.data.frame()\r","    }\r","\r","    if (check.BIG) {\r","        cat(paste0(nrow(raw), \" lines read from the selected raw summary statistics file!\"), sep = \"\\n\")\r","    } else {\r","        cat(paste0(nrow(raw), \" lines read from the raw summary statistics file!\"), sep = \"\\n\")\r","    }\r","    cat(separator, sep = \"\\n\")\r","\r","    # Get the header\r","    header.inner <- colnames(raw)\r","\r","    # Auto mode or not?\r","    if (\"V1\" %in% header.inner | \"V2\" %in% header.inner | \"V3\" %in% header.inner & auto) {\r","        cat(\"I don't see any header! Switch to interactive mode!\", sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Start interacting\r","    if (auto == FALSE) {\r","        # Print the head of the input data set\r","        cat(\"Following are the first few lines of the dataset:\", sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        print(head(raw))\r","        cat(separator, sep = \"\\n\")\r","\r","        # Ask user for reasonable column names\r","        cat(\"Feel free to input whatever column names you want as long as they are unique! Press ENTER to skip a column!\", sep = \"\\n\")\r","        for (index in 1:ncol(raw)) {\r","            header.inner[index] <- readline(prompt = paste0(\"What would be a proper column name for \", colnames(raw)[index], \"? \"))\r","        }\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Make a copy of the desired header\r","    header.outer <- header.inner\r","\r","    ######################\r","    # Process the header #\r","    ######################\r","\r","    # Initialize the header\r","    header.inner <- tolower(header.inner)\r","\r","    # SNP\r","    try.snp <- c(\"snp\", \"markername\", \"snpid\", \"rs\", \"rsid\", \"rs_number\", \"snps\")\r","    header.inner[header.inner %in% try.snp] <- \"SNP\"\r","\r","    # A1\r","    try.a1 <- c(\"a1\", \"allele1\", \"allele_1\", \"effect_allele\", \"reference_allele\", \"inc_allele\", \"ea\", \"ref\", \"a1lele1\", \"al1ele1\")\r","    header.inner[header.inner %in% try.a1] <- \"A1\"\r","\r","    # A2\r","    try.a2 <- c(\"a2\", \"allele2\", \"allele_2\", \"other_allele\", \"non_effect_allele\", \"dec_allele\", \"nea\", \"alt\", \"a0\")\r","    header.inner[header.inner %in% try.a2] <- \"A2\"\r","\r","    # Z-score\r","    try.z <- c(\"zscore\", \"z-score\", \"gc_zscore\", \"z\")\r","    header.inner[header.inner %in% try.z] <- \"Z\"\r","\r","    # P\r","    try.p <- c(\"pvalue\", \"p_value\", \"pval\", \"p_val\", \"gc_pvalue\", \"p\")\r","    header.inner[header.inner %in% try.p] <- \"P\"\r","\r","    # Beta\r","    try.beta <- c(\"b\", \"beta\", \"effects\", \"effect\")\r","    header.inner[header.inner %in% try.beta] <- \"BETA\"\r","\r","    # Odds ratio\r","    try.or <- c(\"or\")\r","    header.inner[header.inner %in% try.or] <- \"ODDS_RATIO\"\r","\r","    # Log odds\r","    try.logodds <- c(\"log_odds\", \"logor\", \"log_or\")\r","    header.inner[header.inner %in% try.logodds] <- \"LOG_ODDS\"\r","\r","    # MAF\r","    try.maf <- c(\"eaf\", \"frq\", \"maf\", \"frq_u\", \"f_u\", \"freq\")\r","    header.inner[header.inner %in% try.maf] <- \"MAF\"\r","\r","    # INFO\r","    try.info <- c(\"info\", \"info_score\")\r","    header.inner[header.inner %in% try.info] <- \"INFO\"\r","\r","    # Chromosome\r","    try.chromosome <- c(\"chrom\", \"ch\", \"chr\", \"chromosome\")\r","    header.inner[header.inner %in% try.chromosome] <- \"CHROMOSOME\"\r","\r","    # Position\r","    try.position <- c(\"pos\", \"posit\", \"position\", \"bp\", \"bpos\")\r","    header.inner[header.inner %in% try.position] <- \"POSITION\"\r","\r","    # Standard error\r","    try.se <- c(\"se\", \"sebeta\", \"beta_se\")\r","    header.inner[header.inner %in% try.se] <- \"SE\"\r","\r","    # CHR plus POSITION\r","    try.chrpos <- c(\"chr:pos\", \"chr_pos\", \"chr-pos\", \"chrpos\")\r","    header.inner[header.inner %in% try.chrpos] <- \"CHR_POS\"\r","\r","    # Samplesize\r","    try.samplesize <- c(\"n\", \"samplesize\", \"num_samples\", \"sample\")\r","    header.inner[header.inner %in% try.samplesize] <- \"SAMPLESIZE\"\r","\r","    # Update the header\r","    colnames(raw) <- header.inner\r","\r","    # Drop some rows\r","    n.start <- ncol(raw)\r","\r","    raw <- raw[, which(colnames(raw) != \"\")]\r","    header.outer <- header.outer[header.outer != \"\"]\r","    header.inner <- header.inner[header.inner != \"\"]\r","\r","    n.end <- ncol(raw)\r","    cat(paste0(n.start - n.end, \" columns were dropped from the input dataset!\"), sep = \"\\n\")\r","    cat(separator, sep = \"\\n\")\r","\r","    # Double-check the class of each column and coerce if needed\r","    list.coerce <- c(\"Z\", \"P\", \"BETA\", \"ODDS_RATIO\", \"LOG_ODDS\", \"MAF\", \"INFO\", \"SE\")\r","\r","    options(warn = -1)\r","    if (\"POSITION\" %in% header.inner) {\r","        if (class(raw$POSITION) == \"character\") {\r","            class(raw$POSITION) <- \"integer\"\r","            cat(paste0(\"Column POSITION has wrong class and has been coerced to integer.\"), sep = \"\\n\")\r","            cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    for (i in 1:length(header.inner)) {\r","        if (header.inner[i] %in% list.coerce) {\r","            if (class(raw[, header.inner[i]]) != \"numeric\") {\r","                class(raw[, header.inner[i]]) <- \"numeric\"\r","                cat(paste0(\"Column \", header.inner[i], \" has wrong class and has been coerced to numeric.\"), sep = \"\\n\")\r","                cat(separator, sep = \"\\n\")\r","            }\r","        }\r","    }\r","    options(warn = 0)\r","\r","    # Drop rows with missing values\r","    do.missing <- readline(prompt = \"Drop rows with missing values? Y/N \")\r","\r","    if (do.missing == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[complete.cases(raw), ]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","\r","        if ((n.start - n.end) / n.start >= 0.8) {\r","            cat(paste0(round((n.start - n.end) / n.start * 100, digits = 2), \"% of rows were removed!\"), sep = \"\\n\")\r","            cat(\"Please check the dataset manually because I am sensing something fishy.\")\r","            Sys.sleep(5)\r","            .Internal(.invokeRestart(list(NULL, NULL), NULL))\r","        }\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Split CHR_POS\r","    if (\"CHR_POS\" %in% header.inner) {\r","        do.split <- readline(prompt = paste0(\"Do you want me to split the ID column? (This could take a while.) Y/N \")) %>% toupper()\r","        cat(separator, sep = \"\\n\")\r","        if (do.split == \"Y\") {\r","            split.temp <- str_split(raw$CHR_POS, \":\") %>% unlist()\r","            if (sum(grepl(\"chr\", raw$CHR_POS)) != 0) {\r","                split.temp[2 * (1:nrow(raw)) - 1] <- gsub(\"chr\", \"\", split.temp[2 * (1:nrow(raw)) - 1])\r","            }\r","\r","            split.temp <- as.numeric(split.temp)\r","            split.temp <- matrix(split.temp, nrow = nrow(raw), ncol = 2, byrow = TRUE) %>% as.data.frame()\r","            names(split.temp) <- c(\"V1\", \"V2\")\r","\r","            header.inner <- c(header.inner, \"CHROMOSOME\", \"POSITION\")\r","            raw[\"CHROMOSOME\"] <- split.temp[, 1]\r","            raw[\"POSITION\"]   <- split.temp[, 2]\r","\r","            # Print the head of split.temp\r","            cat(\"Following are the first few lines of the splitted column:\", sep = \"\\n\")\r","            cat(separator, sep = \"\\n\")\r","            print(head(split.temp))\r","            cat(separator, sep = \"\\n\")\r","\r","            # Ask user for reasonable column names\r","            cat(\"Feel free to input whatever column names you want as long as they are unique! Press ENTER to skip a column!\", sep = \"\\n\")\r","            for (index in 1:ncol(split.temp)) {\r","                header.outer[length(header.outer) + 1] <- readline(prompt = paste0(\"What would be a proper column name for \", colnames(split.temp)[index], \"? \"))\r","            }\r","            cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    # Problematic rsid\r","    test.1 <- grepl(\":\", raw$SNP)\r","    test.2 <- grepl(\"_\", raw$SNP)\r","    test.3 <- grepl(\"chr\", raw$SNP)\r","    if (sum(test.1 & test.3) == nrow(raw)) {\r","        cat(\"I noticed a pattern (chrX:position) in SNPs' IDs!\", sep = \"\\n\")\r","        do.split <- readline(prompt = paste0(\"Do you want me to split the ID column? (This could take a while.) Y/N \"))\r","        cat(separator, sep = \"\\n\")\r","        if (do.split == \"Y\") {\r","            split.temp <- str_split(raw$SNP, \":\") %>% unlist()\r","            split.temp[2 * (1:nrow(raw)) - 1] <- gsub(\"chr\", \"\", split.temp[2 * (1:nrow(raw)) - 1])\r","\r","            split.temp <- as.numeric(split.temp)\r","            split.temp <- matrix(split.temp, nrow = nrow(raw), ncol = 2, byrow = TRUE) %>% as.data.frame()\r","            names(split.temp) <- c(\"V1\", \"V2\")\r","\r","            header.inner <- c(header.inner, \"CHROMOSOME\", \"POSITION\")\r","            raw[\"CHROMOSOME\"] <- split.temp[, 1]\r","            raw[\"POSITION\"]   <- split.temp[, 2]\r","\r","            # Print the head of split.temp\r","            cat(\"Following are the first few lines of the splitted column:\", sep = \"\\n\")\r","            cat(separator, sep = \"\\n\")\r","            print(head(split.temp))\r","            cat(separator, sep = \"\\n\")\r","\r","            # Ask user for reasonable column names\r","            cat(\"Feel free to input whatever column names you want as long as they are unique! Press ENTER to skip a column!\", sep = \"\\n\")\r","            for (index in 1:ncol(split.temp)) {\r","                header.outer[length(header.outer) + 1] <- readline(prompt = paste0(\"What would be a proper column name for \", colnames(split.temp)[index], \"? \"))\r","            }\r","            cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    if (sum(test.1) != 0) {\r","        cat(paste0(sum(test.1), \" SNPs have ':' in their IDs. Please be careful!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    if (sum(test.2) != 0) {\r","        cat(paste0(sum(test.2), \" SNPs have '_' in their IDs. Please be careful!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Compare raw sumstats with the \"list\" (if provided)\r","    do.hapmap3 <- readline(prompt = paste0(\"Subset the dataset by HapMap3? Y/N \"))\r","    cat(separator, sep = \"\\n\")\r","\r","    if (do.hapmap3 == \"Y\") {\r","        if (!file.exists(\"w_hm3.snplist.bz2\")) {\r","            cat(\"I can't find HapMap3 list file and will try to download one from the Internet.\", sep = \"\\n\")\r","            cat(separator, sep = \"\\n\")\r","            download.file(\"https://data.broadinstitute.org/alkesgroup/LDSCORE/w_hm3.snplist.bz2\", destfile = \"w_hm3.snplist.bz2\", quiet = TRUE)\r","        }\r","        list.hapmap3 <- as.data.frame(fread(\"w_hm3.snplist.bz2\"))\r","\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[raw$SNP %in% list.hapmap3$SNP, ]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Drop rows with MAF<0.01\r","    if (\"MAF\" %in% header.inner) {\r","        do.maf <- readline(prompt = paste0(\"Drop rows with MAF<=0.01? Y/N \"))\r","        if (do.maf == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[raw$MAF >= 0.01,]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        } else {\r","        cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    # Drop rows with INFO<0.9\r","    if (\"INFO\" %in% header.inner) {\r","        do.info <- readline(prompt = paste0(\"Drop rows with INFO <= 0.9? Y/N \"))\r","        if (do.info == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[raw$INFO >= 0.9,]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        } else {\r","        cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    # Drop rows not on chromosome 1-22\r","    if (\"CHROMOSOME\" %in% header.inner) {\r","        raw$CHROMOSOME <- as.character(raw$CHROMOSOME)\r","        if (length(union(unique(raw$CHROMOSOME), as.character(1:22))) != 22) {\r","            do.dropXY <- readline(prompt = paste0(\"Drop SNPs on chromosome X and Y? Y/N \"))\r","            if (do.dropXY == \"Y\") {\r","                n.start <- nrow(raw)\r","                raw <- raw[raw$CHROMOSOME %in% as.character(1:22), ]\r","                n.end <- nrow(raw)\r","                cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","                cat(separator, sep = \"\\n\")\r","            }\r","        }\r","    }\r","\r","    # Drop rows for being on the MHC region\r","    if (\"CHROMOSOME\" %in% header.inner & \"POSITION\" %in% header.inner) {\r","        do.MHC <- readline(prompt = paste0(\"Drop rows on MHC region? Y/N \"))\r","        if (do.MHC == \"Y\") {\r","            n.start <- nrow(raw)\r","            raw$CHROMOSOME <- as.character(raw$CHROMOSOME)\r","            raw <- raw[!(raw$CHROMOSOME == \"6\" & raw$POSITION >= 26000000 & raw$POSITION <= 34000000),]\r","            n.end <- nrow(raw)\r","            cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","            cat(separator, sep = \"\\n\")\r","        } else {\r","            cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    # Transform P into usual range (0,1)\r","    if (\"P\" %in% header.inner) {\r","        if (max(raw$P) > 1 & min(raw$P) < 0) {\r","            do.transform <- readline(prompt = paste0(\"Transform P into usual range (0,1)? Y/N \"))\r","            if (do.transform == \"Y\") {\r","                raw <- transform(raw, P = 10 ^ (-P))\r","                cat(separator, sep = \"\\n\")\r","            } else {\r","                cat(separator, sep = \"\\n\")\r","            }\r","        }\r","    }\r","\r","    # Process A1 and A2\r","    if (\"A1\" %in% header.inner & \"A2\" %in% header.inner) {\r","        # MAKE A1 AND A2 CAPS\r","        raw$A1 <- toupper(raw$A1)\r","        raw$A2 <- toupper(raw$A2)\r","\r","        # Erroneous A1/A2\r","        do.error <- readline(prompt = paste0(\"Drop rows with erroneous A1/A2 ? Y/N \"))\r","        if (do.error == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[raw$A1 == 'A' | raw$A1 == 'C' | raw$A1 == 'T' | raw$A1 == 'G', ]\r","        raw <- raw[raw$A2 == 'A' | raw$A2 == 'C' | raw$A2 == 'T' | raw$A2 == 'G', ]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        } else {\r","        cat(separator, sep = \"\\n\")\r","        }\r","\r","        # Ambigious SNPs\r","        do.ambi <- readline(prompt = paste0(\"Drop ambigious SNPs? Y/N \"))\r","        if (do.ambi == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[!((raw$A1 == 'A' & raw$A2 == 'T') | (raw$A1 == 'T' & raw$A2 == 'A') | (raw$A1 == 'C' & raw$A2 == 'G') | (raw$A1 == 'G' & raw$A2 == 'C')),]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        } else {\r","        cat(separator, sep = \"\\n\")\r","        }\r","    } else {\r","        cat(\"WARNING: There might be some issue with your settings or the data itself! Because I didn't find any A1/A2 columns!\", sep = \"\\n\")\r","    }\r","\r","    # Missing z-score?\r","    calculate.z <- FALSE\r","    if (!(\"Z\" %in% header.inner)) {\r","        do.z <- readline(prompt = paste0(\"No z-score column is found. Do you want me to create one? Y/N \"))\r","        if (do.z == \"Y\") {\r","            if (\"BETA\" %in% header.inner & \"SE\" %in% header.inner) {\r","                raw[\"Z\"] <- raw$BETA / raw$SE\r","                calculate.z <- TRUE\r","            } else if (\"ODDS_RATIO\" %in% header.inner & \"SE\" %in% header.inner) {\r","                raw[\"Z\"] <- log(raw$ODDS_RATIO) / raw$SE\r","                calculate.z <- TRUE\r","            } else if (\"LOG_ODDS\" %in% header.inner & \"SE\" %in% header.inner) {\r","                raw[\"Z\"] <- raw$LOG_ODDS / raw$SE\r","                calculate.z <- TRUE\r","            } else if (\"BETA\" %in% header.inner & \"P\" %in% header.inner) {\r","                raw[\"Z\"] <- sign(raw$BETA) * abs(qnorm(raw$P / 2))\r","                calculate.z <- TRUE\r","            } else if (\"ODDS_RATIO\" %in% header.inner & \"P\" %in% header.inner) {\r","                raw[\"Z\"] <- sign(log(raw$ODDS_RATIO)) * abs(qnorm(raw$P / 2))\r","                calculate.z <- TRUE\r","            } else if (\"LOG_ODDS\" %in% header.inner & \"P\" %in% header.inner) {\r","                raw[\"Z\"] <- sign(raw$ODDS_RATIO) * abs(qnorm(raw$P / 2))\r","                calculate.z <- TRUE\r","            } else {\r","                cat(\"I can't calculate z-score based on the information I have. SAD FACE EMOJI.\", sep = \"\\n\")\r","            }\r","\r","            if (sum(is.na(raw$Z)) != 0) {\r","                n.start <- nrow(raw)\r","                raw <- raw[!is.na(raw$Z),]\r","                n.end <- nrow(raw)\r","                cat(paste0(n.start - n.end, \" rows removed for having invalid z-score!\"), sep = \"\\n\")\r","            }\r","        }\r","        cat(separator, sep = \"\\n\")\r","    }\r","\r","    # Calculate chi^2 and sieve out observations with chi^2 larger than 80\r","    if (\"P\" %in% header.inner) {\r","        do.chi2 <- readline(prompt = paste0(\"Sieve out observations with chi^2 larger than 80? Y/N \"))\r","        if (do.chi2 == \"Y\") {\r","        n.start <- nrow(raw)\r","\r","        raw <- raw[qchisq(raw$P, 1, lower.tail = FALSE) <= 80,]\r","\r","        n.end <- nrow(raw)\r","        cat(paste0(n.start - n.end, \" rows removed!\"), sep = \"\\n\")\r","        cat(separator, sep = \"\\n\")\r","        } else {\r","        cat(separator, sep = \"\\n\")\r","        }\r","    }\r","\r","    # Update the header\r","    if (calculate.z) {\r","        header.inner <- c(header.inner, \"Z\")\r","        header.outer <- c(header.outer, \"Z\")\r","    }\r","    colnames(raw) <- header.outer\r","\r","    # Display output\r","    cat(\"Now take a final look at the output!\", sep = \"\\n\")\r","    print(head(raw))\r","\r","    cat(separator, sep = \"\\n\")\r","\r","    # Output\r","    do.output <- readline(prompt = \"Do you want to write the processed summary statistics to your hard drive? Y/N \") %>% toupper()\r","    if (do.output == \"Y\") {\r","        char.write <- readline(prompt = \"Please input your desired filename (with extension and if no input is given, a default name will be assigned):\")\r","        if (char.write == \"\") {\r","            char.write <- paste0(filename, \".sumstats\")\r","        }\r","        fwrite(raw, file = char.write, sep = \" \", row.names = FALSE, quote = FALSE)\r","\r","        CHROMOSOME <- raw[, header.inner == \"CHROMOSOME\"]\r","        for (i in unique(CHROMOSOME)) {\r","            fwrite(raw[CHROMOSOME == i, ], file = paste0(filename, \"-\", i, \".sumstats\"), sep = \" \", row.names = FALSE, quote = FALSE)\r","        }\r","    }\r","\r","    # Return?\r","    if (do.return) {\r","        return(raw)\r","    }\r","}\r"],"stylingDirectives":[[{"start":0,"end":4,"cssClass":"pl-en"},{"start":5,"end":7,"cssClass":"pl-k"},{"start":8,"end":16,"cssClass":"pl-k"},{"start":17,"end":34,"cssClass":"pl-smi"},{"start":36,"end":44,"cssClass":"pl-smi"},{"start":46,"end":50,"cssClass":"pl-v"},{"start":51,"end":52,"cssClass":"pl-k"},{"start":53,"end":58,"cssClass":"pl-c1"},{"start":60,"end":69,"cssClass":"pl-v"},{"start":70,"end":71,"cssClass":"pl-k"},{"start":72,"end":77,"cssClass":"pl-c1"},{"start":79,"end":82,"cssClass":"pl-v"},{"start":83,"end":84,"cssClass":"pl-k"},{"start":85,"end":86,"cssClass":"pl-c1"}],[{"start":4,"end":14,"cssClass":"pl-c"},{"start":4,"end":5,"cssClass":"pl-c"}],[{"start":29,"end":39,"cssClass":"pl-smi"}],[{"start":29,"end":37,"cssClass":"pl-smi"}],[{"start":29,"end":36,"c